export const summ = (e) => ({
  type: 'SUMM',
  value: e.target.value,
})

export const surname = (e) => ({
  type: 'DATE',
  value: e.target.value,
})

export const phone = (e) => ({
  type: 'DESCRIPTION',
  value: e.target.value,
})

export const email = (e) => ({
  type: 'CATEGORIES',
  value: e.target.value,
})
